import React, { Fragment } from "react";
import Header from "./Components/Header";
import styled from "@emotion/styled";

const Container = styled.div`
  max-width: 600px;
  margin: 0 auto;
`;

function App() {
  return (
    <Fragment>
      <Header title="Cotizador de Seguros" />
    </Fragment>
  );
}

export default App;
